// src/components/GuestPage.js
import React from 'react';
import FlightList from './FlightList';

function GuestPage() {
  return (
    <div>
      <h1>Welcome, Guest!</h1>
      <p>Please login to book your tickets.</p>
      <FlightList isLoggedIn={false} />
    </div>
  );
}

export default GuestPage;
